import styled from 'styled-components';

export const SignUpWrapper = styled.div`
  width: 380px;
  margin: 30px auto;
  padding: 0 30px;
  position: relative;


  .sign-up {
    width: 80px;
    position: relative;
    font-size: 14px;
    margin: 30px auto;
  }
`

export const SignUpTitle = styled.h2`
  margin: 10px 0;
  text-align: center;
`
